INSERT INTO `tb_dictionary` VALUES ('54', 'protocol.community', '<p style=\'text-align: center;\'><img src=\'https://stack-1251694474.cos.ap-guangzhou.myqcloud.com/zhixiao/jhk-1550942824173.jpeg\' width=\'100%\'/></p><p><strong><span style=\'font-size: 18px;\'><br/></span></strong></p><p><strong><span style=\'font-size: 18px;\'><br/></span></strong></p><p><strong><span style=\'font-size: 18px;\'>在这个大家庭里，为了给朋友们创造一个和谐友好、真诚分享交流的社区氛围，希望朋友们可以按照规范，共同维护我们的社区环境。</span></strong></p><p><br/></p><h2>01</h2><p><br/></p><p>禁止在朋友圈、评论中发布和传播违法违规内容</p><p><br/></p><p>1.根据现法律法规，危害国家及社会安全的信息</p><p><br/></p><p>违法违规内容包括但限于:</p><p><br/></p><p>反对宪法确定的基本原则</p><p><br/></p><p>危害国家安全，泄露国家机密，颠覆国家政权，破坏国家统一、主权和领土完整</p><p><br/></p><p>损害国家荣誉和利益</p><p><br/></p><p>煽动民族分裂、民族仇恨、民族歧视，侵害少数民族民俗习惯，破坏民族团结</p><p><br/></p><p>煽动地域歧视、地域仇恨</p><p><br/></p><p>破坏国家宗教政策、宣扬邪教和封建迷信</p><p><br/></p><p>危害社会公德或者民族优秀文化传统</p><p><br/></p><p>侮辱、滥⽤英烈形象，否定英雄事迹，美化粉饰侵略者和侵略战争行为</p><p><br/></p><p>传授犯罪方法或宣扬美化犯罪分子和犯罪行为</p><p><br/></p><p>编造或散布谣言、虚假信息，扰乱社会秩序，破坏社会稳定</p><p><br/></p><p>煽动非法集会、结社、游行、示威、聚众扰乱社会秩序</p><p><br/></p><p>散布污言秽语，损害社会公序良俗</p><p><br/></p><p>有关法律、行政法规和国家规定禁止的其他内容</p><p><br/></p><p>2.色情低俗内容</p><p><br/></p><p>直接暴露和描写人体性部位的内容</p><p><br/></p><p>全身或者隐私部位未着衣物，仅人肢体掩盖隐私部位的内容</p><p><br/></p><p>表现或隐晦表现性行为、具有挑逗性或者侮辱性的内容</p><p><br/></p><p>以庸俗和挑逗性标题吸引点击的内容</p><p><br/></p><p>以带有性暗示、性挑逗的语言描述性行为、性过程、等的内容</p><p><br/></p><p>相关部门禁止传播的色情和有伤社会风化的文字、视频内容，包括一些电影的删节片段</p><p><br/></p><p>情色动漫</p><p><br/></p><p>传播一夜情、换妻、性虐待等的有害信息</p><p><br/></p><p>违法性药品广告和性病治疗广告等相关内容</p><p><br/></p><p>推介淫秽色情网站和网上低俗信息的链接、图片、文字等内容</p><p><br/></p><p>提供色情服务</p><p><br/></p><p>其他宣扬淫秽、色情的内容</p><p><br/></p><p>3.暴力恐怖内容</p><p><br/></p><p>宣扬暴力、凶杀、恐怖主义、极端主义或者教唆犯罪</p><p><br/></p><p>散播或动物被杀，致残以及枪击、刺伤、拷打等受伤情形的真实画面</p><p><br/></p><p>暴力，虐待儿童</p><p><br/></p><p>含激烈冲突或血腥且引起生理不适的内容</p><p><br/></p><p>骇人视听、令人感到不安、难受甚至严重不适的内容</p><p><br/></p><p>4.赌博类内容</p><p><br/></p><p>六合彩、赌球、赌博交易平台的信息</p><p><br/></p><p>赌博交易平台的链接、二维码、邀请码等信息</p><p><br/></p><p>老虎机、赌博机、透视扑克等具有赌博性质的器具及其相关作弊工具信息</p><p><br/></p><p>关于币商、中介、游戏币回收等网络赌博性质类服务的信息</p><p><br/></p><p>聚众赌博、出售赌博器具</p><p><br/></p><p>传授赌博技巧及进行博彩活动等一切赌博类内容</p><p><br/></p><p>5.其他违法信息</p><p><br/></p><p>展示未成年人婚育的内容</p><p><br/></p><p>诱导未成年人违法犯罪，侵害未成年人合法权益或者损害未成年人身心健康的内容</p><p><br/></p><p>披露未成年人的个人隐私或有损未成年人人格尊严的内容</p><p><br/></p><p>发布含有潜在危险的内容，或使用第三方网站伪造跳转链接，如钓鱼网站、木马、病毒网站等</p><p><br/></p><h2></h2><h2>02</h2><p><br/></p><p>不能在个人信息、评论、笔记、专辑、私信中发布侵权内容</p><p><br/></p><p>侵权内容包括但不限于:</p><p><br/></p><p>1.不友善行为</p><p><br/></p><p>含有嘲讽、挑衅、羞辱、谩骂、歧视、威胁等不友善内容</p><p><br/></p><p>干扰用户判断、敲诈勒索、发布仇恨评论以及恶意引战的行为</p><p><br/></p><p>恶意煽动攻击或以其他手段不友善地对待其他用户的内容</p><p><br/></p><p>因民族、种族、宗教、性取向、性别、年龄、地域、生理特征等身份或者归类歧视、侮辱、攻击他人的行为</p><p><br/></p><p>利用平台以骚扰他人或推广营销为的重复发布相似笔记、评论、私信或不同账号互相配合发布相似内容等行为</p><p><br/></p><p>其他一切对我方的运营安全造成潜在威胁的行为</p><p><br/></p><p>2.非原创</p><p><br/></p><p>未经授权发布从互联网上复制或收集到的图片、视频或⽂字等内容，存在侵犯他人知识产权、著作权和肖像权等行为</p><p><br/></p><p>3.其他侵权内容</p><p><br/></p><p>泄露他人隐私或带有侵犯个人隐私性质的曝光、偷拍、漏点等内容</p><p><br/></p><p>发布虚假谣言、事实依据的不实内容等虚假内容</p><p><br/></p><p>冒充他人，通过头像、用户名等个人信息暗示自己与他人或机构相等同或有关联</p><p><br/></p><p>其他侵犯任何个人、企业事业单位或社会团体的合法权益的内容，包括但不限于专利权、著作权、商标权或姓名权、名称权、名誉权、荣誉权、肖像权、隐私权等</p><p><br/></p><h2></h2><h2>03</h2><p><br/></p><p>不能在个人信息、评论、笔记、专辑、私信中发布垃圾广告信息</p><p><br/></p><p>垃圾广告信息，包括但不限于以推广、销售、盈利为目的，发布影响⽤户体验的内容</p><p><br/></p><p>发布含广告销售意图的文字，如“可代购”、“找我购买”、“转卖”、“拼单”等</p><p><br/></p><p>发布含具体广告销售方式或不合规的联系方式，如个人手机号、闲鱼号、QQ、淘宝店铺、淘口令、微店、微信、购买链接等</p><p><br/></p><p>发布含广告销售意图的图片，如图中含有二维码、购买水印</p><p><br/></p><p>发布包含欺骗性的恶意营销内容，如通过伪造经历、冒充他人等方式进行恶意营销</p><p><br/></p><p>多个账号互相配合发布包含垃圾广告的内容</p><p><br/></p><p>兜售或贩卖各类法律法规所规定的禁止流通物和限制流通物，如枪支或违法/处方药品(即使在您的地区合法)</p><p><br/></p><h2></h2><h2>04</h2><p><br/></p><p>不能针对账号以及内容(包括笔记、评论等)伪造互动数据</p><p><br/></p><p>伪造互动数据，包括但不限于</p><p><br/></p><p>以伪造在社区内的影响为目的，人工干预或制造虚假的粉丝数、点赞数、收藏数等互动数据</p><p><br/></p><p>为收集粉丝、评论、点赞或收藏数，扰乱社区秩序</p><p><br/></p><p>使用机器、恶意程序手段或人为有组织性地操控账号并伪造互动数据</p><p><br/></p><p>恶意注册使用账号，包括但不限于机器注册、频繁注册、批量注册、泛滥多个账号</p><p><br/></p><p>请大家一同来维护这个热爱分享、真诚交流的社区，朋友们如果发现此类内容欢迎积极举报给平台！</p><p><br/></p><p>平台可根据法律要求或现实需要，对社区规范进行修改和解释。</p><p><br/></p><p><br/></p>');
