INSERT INTO `tb_dictionary` VALUES ('56', 'protocol.service', '<h4>在使用本系统的所有功能之前,请您务必仔细阅读并透彻理解本声明。您可以选择不使用本系统,但如果您使用本系统,您的使用行为将被视为对本声明全部内容的认可。</h4><p>&nbsp;&nbsp;<br/></p><h4>免责声明:</h4><p>鉴于本系统使用非人工检索/分析方式无法确定您输入的条件进行是否合法,所以本系统对检索分析出的结果不承担责任。如果因以本系统的检索/分析结果作为任何商业行为或者学术研究的依据而产生不良后果,本系统不承担任何法律责任。<br/><br/></p><h4>关于隐私权:</h4><p>访问者在本系统注册时提供的一些个人资料,本系统除您本人同意外不会将用户的任何资料以任何方式泄露给第三方。当政府部门、司法机关等依照法定程序要求本系统披露个人资料时,本系统将根据执法单位之要求或为公共安全之目的提供个人资料,在此情况下的披露,本系统不承担任何责任。<br/><br/></p><h4>关于版权:</h4><p>一、凡本系统注明我方的所有作品,其版权属于我方和本系统所有。其他媒体、网站或个人转载使用时不得进行商业性的原版原式的转载也不得歪曲和篡改本系统所发布的内容。<br/>二、被本系统授权使用的单位,不应超越授权范围。<br/>三、本系统提供的资料如与相关纸质文本不符,以纸质文本为准。<br/>四、如因作品内容、版权和其它问题需要同本系统联系的,请在本系统发布该作品后的3日内进行。<br/><br/></p><h4>关于解释权:</h4><p>本系统之声明以及其修改权、更新权及最终解释权均属本站所有。<br/><br/></p><h4>我方免责声明</h4><p>我方提供的服务将完全按照其发布的章程、服务条款和操作规则严格执行。会员若完全同意所有服务条款,并完成注册程序,即可成为我方的正式会员。基于我方提供的网络服务的商业性和时效性:<br/>(1)会员对其发布的信息负责,应提供详尽、真实、准确的企业资料,不得发布不真实的、有歧义的信息,绝对禁止发布误导性的、恶意的消息。<br/>(2)随时更新注册资料,以符合及时、详尽、准确的要求。<br/>(3)我方向会员提供的会员帐号及密码只供会员使用如果会员将帐号或密码丢失或被盗,应及时重新登记并重新设置密码。会员造成的帐号失密,应自行承担责任。<br/>(4)会员发现我方发布的信息不准确或发生错误,以及其它错误行为,应及时通知本网。若问题未能及时解决,可进入本网的投诉程序。<br/>(5)我方向会员提供的商品信息之编辑、编制、传播的版权和知识产权,全部由我方拥有;未经我方事先以书面表示同意,任何人不得以各种形式复制、散布、出售、出版、广播、转播该商品信息。<br/>(6)我方如发现会员提供的资料包含有不正确或者违法的信息,将发出警告,并保留停止或终止其会员资格的权利。<br/>(7)会员如违反本协议而造成我方的经济损失,本网有权追究其经济责任与法律责任。员权利与义务<br/><br/></p><h4>会员权利与义务</h4><p>(1)会员承诺遵守法律法规、社会主义制度、国家利益、公民合法权益、公共秩序、社会道德风尚和信息真实性等七条底线;<br/>(2)会员在其名称、头像和简介等注册信息中不得出现违法和不良信息;<br/>(3)我方将配备与服务规模相适应的专业人员,对会员提交的账号名称、头像和简介等注册信息进行审核,对含有违法和不良信息的,不予注册,对会员发布的违法信息,有权进行删除处理,多次出现违法行为的账号,我方有权删除账号,并不退还相关款项。<br/>(4)我方保护用户信息及公民个人隐私,自觉接受社会监督,及时处理公众举报的账号名称、头像和简介等注册信息中的违法和不良信息。<br/>会员的所有行为必须符合国家法律的规定,如违反国家法律规定和本协议,出现任何纠纷及不良结果,将由行为人独立承担所有责任。<br/><br/>本网站上的信息本网站上关于我方会员或他们的产品(包括但不限于公司名称、联系人及联络信息,产品的描述和说明,相关图片、视讯等)的信息均由会员自行提供,会员依法应对其提供的任何信息承担全部责任。IUP对此等信息的准确性、完整性、合法性或真实性均不承担任何责任。此外,我方对任何使用或提供本网站信息的商业活动及其风险不承担任何责任。<br/><br/>未经合法权利人的书面许可,任何人严禁在本网站展示产品图片。任何未经授权便在本网站上使用该图片都可能违反国际法,商标法,隐私权法,通讯、通信等法律法规。<br/><br/>浏览者可以截图我方显示的资料,但这些资料只限用于个人学习研究使用,不得用于任何商业用途,无论是否在资料上明示,所有此等资料都是受到版权法的法律保护。浏览者没有获得我方或各自的版权所有者明确的书面同意下,不得分发、修改、散布、再使用、再传递或使用本网站的内容用于任何公众商业用途。</p>');
INSERT INTO `tb_dictionary` VALUES ('57', 'protocol.privacy', '<h4>本软件尊重并保护所有使用服务用户的个人隐私权。为了给您提供更准确、更有个性化的服务，本软件会按照本隐私权政策的规定使用和披露您的个人信息。但本软件将以高度的勤勉、审慎义务对待这些信息。除本隐私权政策另有规定外，在未征得您事先许可的情况下，本软件不会将这些信息对外披露或向第三方提供。本软件会不时更新本隐私权政策。您在同意本软件服务使用协议之时，即视为您已经同意本隐私权政策全部内容。本隐私权政策属于本软件服务使用协议不可分割的一部分。</h4><p><br/></p><h2><strong>1.适用范围</strong></h2><p>a)在您使用本软件网络服务，本软件自动接收并记录的您的手机上的信息，包括但不限于您的健康数据、使用的语言、访问日期和时间、软硬件特征信息及您需求的网页记录等数据；</p><p><br/></p><p><br/></p><h2><strong>2.信息的使用</strong></h2><p>a)在获得您的数据之后，本软件会将其上传至服务器，以生成您的排行榜数据，以便您能够更好地使用服务。</p><p><br/></p><p><br/></p><h2><strong>3.信息披露</strong></h2><p>a)本软件不会将您的信息披露给不受信任的第三方。</p><p>b)根据法律的有关规定，或者行政或司法机构的要求，向第三方或者行政、司法机构披露；</p><p>c)如您出现违反中国有关法律、法规或者相关规则的情况，需要向第三方披露；</p><p><br/></p><p><br/></p><h2><strong>4.信息存储和交换</strong></h2><p>本软件收集的有关您的信息和资料将保存在本软件及（或）其关联公司的服务器上，这些信息和资料可能传送至您所在国家、地区或本软件收集信息和资料所在地的境外并在境外被访问、存储和展示。</p><p><br/></p><p><br/></p><h2><strong>5.信息安全</strong></h2><p>a)在使用本软件网络服务进行网上交易时，您不可避免的要向交易对方或潜在的交易对方披露自己的个人信息，如联络方式或者邮政地址。请您妥善保护自己的个人信息，仅在必要的情形下向他人提供。如您发现自己的个人信息泄密，请您立即联络本软件客服，以便本软件采取相应措施。</p><p><br/></p>');
INSERT INTO `tb_dictionary` VALUES ('58', 'protocol.contact', '<p style=\"text-align: center;  font-size: 20px; font-weight: bold;\">打开微信扫一扫,加我好友</p><br><p style=\"text-align: center;\">&nbsp;<img src=\"https://stack-1251694474.cos.ap-guangzhou.myqcloud.com/upload/5e168429-2f05-4dd0-9c19-a06363552d04.png\" style=\"max-width: 100%;\"><br></p><br><p style=\"white-space: normal; text-align: center; color: #b6b6b6;\">由于接待人数太多，请直接说明您的问题，谢谢理解！</p><p><br></p>');
